      flex-wrap: nowrap;
    }







    /* Logo */

    #logobig {
      max-width: 100%;
      max-height: 200px;
      object-fit: contain;
      animation: breathing 2.5s infinite ease-in-out;
      transition: transform 0.3s ease-in-out;
    }

    #logobig:hover {
      transform: scale(1.15) translateY(10px);
      transition: 0.2s;
    }

    @keyframes breathing {
      0% {
        transform: translateY(0) scale(1);
      }

      50% {
        transform: translateY(-2px) scale(1);
      }

      100% {
        transform: translateY(0) scale(1);
      }
    }



    .caixamaisclara {
      padding: 0.9375rem;
      border-radius: 0.9375rem;
      box-shadow: 0 0 1.25rem rgba(0, 0, 0, 0.5);

    .about-text {

    hr {

      margin: 1.25rem 0;
    }




    .grid-feed {
      display: grid;
      grid-template-columns: repeat(3, 1fr);

      gap: 10px;

      max-width: 800px;


    }

    .grid-feed a {
      display: block;
      position: relative;
      max-width: 800px;
      max-height: 800px;
      display: block;

    }



    #container img {
      max-width: 100%;
      display: block;

    }

    .fancybox__caption {
      font-size: 25px;
      color: #534f4a;
      border-color: #24211e
    }

    a[data-fancybox="gallery"] {
      display: block;
      width: 250px;
      height: 250px;
      overflow: hidden;
      border-radius: 8px;
    }

    a[data-fancybox="gallery"] img {
      width: 100%;
      height: 100%;
      object-fit: cover;

    }
